import React, { useEffect } from "react";
import { Link } from "react-router-dom";
function BuildCard({ el }) {
  // console.log(el);
  return (
    <div className='card'>
      <h3>{el.buildname} </h3>
      <Link to='/build'>
        {el.photos.map((el) =>
          el.backgroundimage.map((el) => <img className='buildcardIMG' src={el.path} alt='background' />)
        )}
      </Link>
    </div>
  );
}

export default BuildCard;
